import "./ExpenseItem.css";
const ExpenseItem = function () {
  const dateExpense = "30 Jan 2023";
  const item = "Insurance";

  return (
    <div className="expense-item">
      <div>{dateExpense} </div>
      <div className="expense-item__description"> {item} </div>
      <div className="expense-item__price">3000 INR</div>
    </div>
  );
};

export default ExpenseItem;
